import React from 'react'
// import './NestedMapping.css'


function NestedMapping() {
  return (
    <div className='container'>
           
       {UserList.map((user)=>(
        
        <article>
            <p>Name:{user.name}</p>
            <p>population:{user.population}</p>
            {user.country((items)=><div>
              <p>{items.education}</p>
              <p>{items.duck}</p>
            </div>)}
        </article>
       ))}

    </div>
  )
}

export default NestedMapping
